import React, {Component} from 'react';
import {Button} from "react-bootstrap";
import App from "../../../App";

class LoginComponent extends Component {

    constructor(props) {
        super(props);

    }

    render() {
        return (
            <div>
                <h3>Login page</h3>
                <Button onClick={() => {
                    this.props.login(true);
                    console.log("Logged")
                }
                }>Login</Button>
            </div>
        );
    }
}

export default LoginComponent;
